import image_navbar from '../../assents/images/image.svg';
import image_filme from '../../assents/images/image_filme.svg';
import './Navbar.css';

export default function Navbar({films}) {

    if(films){
        return (
            <div className="conteudo"> 
                <img src={image_filme}/>


                <div>
                        <h1 className="filme">
                            {films.title}
                        </h1>

                </div>
            </div>
        );

    }else{
        return (
            <div className="conteudo"> 
                <img src={image_navbar}/>
                <div>
                        <h1>
                            Star Wars movies
                        </h1>
                        <form className="d-flex justify-content-center">  
                            <input />
                        </form>
                </div>
            </div>
        );

        }
};
